import React, { Component } from 'react';
// import logo from './logo.svg';
import './Login.css';



// var errormsg
class Login extends Component {
    routeTocontact()
    {
    this.props.history.push('/forget'); //redirect another page it will redirect contact page(path='/contact' from router.js)
    }

    render() {
        return (

            <div className="body">
                <div className="container">
                    <div className="p-3 text-light">                

                        <div className="form-group text-center mx-auto" style={{marginTop: "10%"}}>

                            <div  className="logo-login">Digital Music Sytem</div>
                            <div>
                                <div class="input-container my-4">
                                    <i class="fa fa-user icon"></i>
                                    <input class="input-field" type="text"  placeholder="User ID" name='user_email' />
                                </div>

                                <div class="input-container my-4">
                                  <i class="fa fa-key icon"></i>
                                  <input class="input-field" type="password" placeholder="Password" name='user_password'  />
                                </div>

                                <div><button className="submit mt-5 mb-3" >LogIn</button></div>
                                <p className="">Have not an account ? <a className="forget"  href="#" >Sign Up</a></p>
                                <button style={forgetStyle} onClick={this.routeTocontact.bind(this)}>Forget password</button>
                            </div>
                        </div>
                    </div>
                </div>

            </div>


        );
    }
}

export default Login;
